import pandas as pd
import os
import math
import sys
import io
import base64
import tkinter as tk
from tkinter import messagebox
from fpdf import FPDF 
from PIL import Image, ImageTk

# --- LOGO CENTRAL ENCRIPTADO (logoAsisman.png) ---
LOGO_BASE64 = "" 

# --- CLASE PARA EL PDF ---
class PDF_Etiquetas(FPDF):
    def __init__(self):
        super().__init__(orientation='P', unit='mm', format='A4')
        self.set_margins(8, 10, 8)
        self.set_auto_page_break(auto=False)

def procesar_etiquetas_pdf(ancho_mm, alto_mm):
    archivo_csv = "etiquetas.csv"
    carpeta_salida = "imprimir"
    
    if not os.path.exists(carpeta_salida):
        os.makedirs(carpeta_salida)
    
    nombre_salida = os.path.join(carpeta_salida, f"Etiquetas_{ancho_mm}x{alto_mm}.pdf")
    
    if os.path.exists(nombre_salida):
        try:
            os.remove(nombre_salida)
        except:
            messagebox.showerror("Archivo en uso", "Cierre el PDF antes de generar uno nuevo.")
            return

    if not os.path.exists(archivo_csv):
        messagebox.showerror("Error", "No se encuentra 'etiquetas.csv'.")
        return

    try:
        try:
            df = pd.read_csv(archivo_csv, encoding='cp1252', sep=None, engine='python')
        except:
            df = pd.read_csv(archivo_csv, encoding='utf-8', sep=None, engine='python')
        df = df.fillna("")
    except Exception as e:
        messagebox.showerror("Error al leer CSV", f"Error: {e}")
        return

    pdf = PDF_Etiquetas()
    pdf.add_page()
    
    margin_left = 8
    margin_top = 10
    columnas = math.floor((210 - 16) / ancho_mm)
    filas = math.floor((297 - 20) / alto_mm)
    
    x_actual = margin_left
    y_actual = margin_top
    count_col = 0
    count_fil = 0

    for index, fila in df.iterrows():
        pdf.set_draw_color(230, 230, 230)
        pdf.rect(x_actual, y_actual, ancho_mm, alto_mm)
        
        # --- TEXTO PRODUCTO (Tamao 12) ---
        pdf.set_xy(x_actual + 2, y_actual + 3)
        pdf.set_font("helvetica", "", 12)
        producto = str(fila['Producto']).replace("", chr(128))
        pdf.multi_cell(ancho_mm - 4, 4, producto.encode('latin-1', 'replace').decode('latin-1'), align='L')
        
        # --- TEXTO PRECIO (Unificado y misma altura) ---
        # Calculamos la posicin vertical centrada segn el alto de la etiqueta
        offset_y = 12 if alto_mm == 30 else 20
        
        # Limpiamos el valor del precio
        precio_val = str(fila['Precio']).replace("", "").strip()
        precio_final = f"{precio_val} {chr(128)}"
        
        # Definimos el punto de inicio X para que el bloque conjunto parezca centrado
        # Aproximadamente restamos 10mm del centro para compensar el texto P.V.P
        pdf.set_xy(x_actual + (ancho_mm / 4), y_actual + offset_y)
        
        # 1. Escribimos "P.V.P " (Tamao 14)
        pdf.set_font("helvetica", "B", 12)
        pdf.write(10, "P.V.P ".encode('latin-1', 'replace').decode('latin-1'))
        
        # 2. Escribimos el Valor (Tamao 20) a continuacin inmediata
        pdf.set_font("helvetica", "B", 28)
        pdf.write(10, precio_final.encode('latin-1', 'replace').decode('latin-1'))
        
        # --- LGICA DE POSICIONAMIENTO ---
        count_col += 1
        if count_col < columnas:
            x_actual += ancho_mm
        else:
            count_col = 0
            x_actual = margin_left
            count_fil += 1
            if count_fil < filas:
                y_actual += alto_mm
            else:
                if index < len(df) - 1:
                    pdf.add_page()
                    count_fil = 0
                    y_actual = margin_top
                    x_actual = margin_left

    try:
        pdf.output(nombre_salida)
        os.startfile(nombre_salida)
    except Exception as e:
        messagebox.showerror("Error al guardar", f"No se pudo crear el PDF:\n{e}")

# --- INTERFAZ ---
root = tk.Tk()
root.title("Asisman - Generador PDF Pro")
root.geometry("450x450")
root.resizable(False, False)

tk.Label(root, text="Panel de Etiquetas PDF", font=("Arial", 14, "bold"), pady=10).pack()
tk.Label(root, text="Compatible con Office 2003 y versiones modernas.", 
         font=("Arial", 9, "italic"), fg="#003366", wraplength=400).pack(pady=5)

tk.Button(root, text="Formato 62x40mm (PDF)", width=35, height=2, command=lambda: procesar_etiquetas_pdf(62, 40)).pack(pady=10)
tk.Button(root, text="Formato 62x30mm (PDF)", width=35, height=2, command=lambda: procesar_etiquetas_pdf(62, 30)).pack(pady=10)

# Carga del logo desde la variable interna (Memoria)
try:
    img_data = base64.b64decode(LOGO_BASE64)
    img_open = Image.open(io.BytesIO(img_data))
    img_open = img_open.resize((200, 60), Image.Resampling.LANCZOS)
    photo = ImageTk.PhotoImage(img_open)
    label_img = tk.Label(root, image=photo)
    label_img.image = photo
    label_img.pack(side="bottom", pady=(0, 20))
except Exception as e:
    print(f"Error cargando logo interno: {e}")

root.mainloop()